pragma solidity ^0.8.8;
import "./PriceConverter.sol";
import "hardhat/console.sol";

error FundMe__NotOwner();

contract FundMe {
    using PriceConverter for uint256;

    uint256 public constant minUsd = 50 * 1e18;
    address[] public funders;
    address public immutable owner;
    mapping(address => uint256) public addressToAmountFunded;

    AggregatorV3Interface public priceFeed;

    constructor(address priceFeedAddress) {
        owner = msg.sender;
        priceFeed = AggregatorV3Interface(priceFeedAddress);
    }

    function fund() public payable {
        // set minimum send amount
        require(
            msg.value.getConversionRate(priceFeed) >= minUsd,
            "Did't send enough"
        );
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender] += msg.value;
    }

    function withdraw() public onlyOwner {
        // conso   le.log("sender", owner);
        address[] memory m_funders = funders;
        for (uint256 _index = 0; _index < m_funders.length; _index++) {
            address funder = m_funders[_index];
            addressToAmountFunded[funder] = 0;
        }

        funders = new address[](0);
        //call
        (bool callSuccess, ) = owner.call{value: address(this).balance}("");
        require(callSuccess, "call failed");
    }

    modifier onlyOwner() {
        if (msg.sender != owner) revert FundMe__NotOwner();
        // if (msg.sender != i_owner) revert NotOwner();
        _;
    }

    receive() external payable {
        fund();
    }

    fallback() external payable {
        fund();
    }
}
","keccak256":"0x7d6648a6b5acea5f60cdd3e45e632b7af27ac87e85e5f56e61c392387ce103f6","license":"MIT"},"contracts/PriceConverter.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    function getPrice(AggregatorV3Interface priceFeedAddress)
        internal
        view
        returns (uint256)
    {
        (, int256 price, , , ) = priceFeedAddress.latestRoundData();

        return uint256(price * 1e10);
    }

    function getConversionRate(
        uint256 _ethAmount,
        AggregatorV3Interface priceFeed
    ) internal view returns (uint256) {
        uint256 ethPrice = getPrice(priceFeed);
        uint256 ethAmountInUsd = (ethPrice * _ethAmount) / 1e18;
        return ethAmountInUsd;
    }
}
